import React from 'react';
import './Login.css'

const Login = () => {
  const handleLogin = () => {
    window.location.href = '/api/auth/google'; // Направляем на Google OAuth
  };

  return (
    <div className="login">
        <div className="login-form">
            <h2>Login</h2>
            <button onClick={handleLogin} className="login-button">
                Login with Google
            </button>
        </div>
    </div>
  );
};

export default Login;
